import '../estilos/App.css';
import Header from './Header';
import MainBanner from './MainBanner';
import SkillsBanner from './SkillsBanner';
import FadeIn from 'react-fade-in';

function App() {
  return (
    <div className="App">
      <Header />
      <MainBanner />
      <SkillsBanner />
    </div>
  );
}

export default App;
